import React from 'react';
import { Link } from 'react-router-dom';

import './styling/HomePageStyling.scss';

function HomePage(){

    return (
        <div className="homepage-container">
            <div className='homepage-buttons'>
                <Link to='/controller/homepage'>
                    <div className='homepage-buttons-home'>
                        <div className='homepage-buttons-home-title'>Home</div>                  
                    </div>
                </Link>
            </div>
            <blockquote class="tiktok-embed" cite="https://www.tiktok.com/@hiso_5/video/7107275289503255813" data-video-id="7107275289503255813" style="max-width: 605px;min-width: 325px;" > <section> <a target="_blank" title="@hiso_5" href="https://www.tiktok.com/@hiso_5">@hiso_5</a> <a title="foryou" target="_blank" href="https://www.tiktok.com/tag/foryou">#foryou</a> <a title="animation" target="_blank" href="https://www.tiktok.com/tag/animation">#animation</a> <a title="weeb" target="_blank" href="https://www.tiktok.com/tag/weeb">#weeb</a> <a title="fyp" target="_blank" href="https://www.tiktok.com/tag/fyp">#fyp</a> <a title="viral" target="_blank" href="https://www.tiktok.com/tag/viral">#viral</a> <a title="fypシ" target="_blank" href="https://www.tiktok.com/tag/fyp%E3%82%B7">#fypシ</a> <a title="hiso_5" target="_blank" href="https://www.tiktok.com/tag/hiso_5">#hiso_5</a> <a title="animeob911" target="_blank" href="https://www.tiktok.com/tag/animeob911">#animeob911</a> <a title="shadowsqd" target="_blank" href="https://www.tiktok.com/tag/shadowsqd">#shadowsqd</a> <a title="anime" target="_blank" href="https://www.tiktok.com/tag/anime">#anime</a> <a target="_blank" title="♬ Love You So - The King Khan &#38; BBQ Show" href="https://www.tiktok.com/music/Love-You-So-6728562975734515713">♬ Love You So - The King Khan &#38; BBQ Show</a> </section> </blockquote> <script async src="https://www.tiktok.com/embed.js"></script>
        </div>
    );
}
export default HomePage;
